import React from 'react';
import './styles.css';
import { NavBarContainer } from './components/navBar/NavBarContainer';
import { BaseHeaderContainer } from './components/baseHeaderBar/baseHeaderContainer';

const App: React.FC = () => {
  return (
    <div className='main'>
      <NavBarContainer />
      <BaseHeaderContainer />
    </div>
  );
};

export default App;
